import React from "react";

function Portfolio() {
  return (
    <div className="portfolio page__container">
      <h2 className="portfolio__title">Портфолио</h2>
      <ul className="portfolio__list">
        <li className="portfolio__list-item"><a href="ссылка на статичный сайт"><p className="portfolio__item-name">Статичный сайт</p></a></li>
        <li className="portfolio__list-item"><a href="ссылка на адаптивный сайт">Адаптивный сайт</a></li>
        <li className="portfolio__list-item"><a href="ссылка на приложение">Одностраничное приложение</a></li>
      </ul>


    </div>
  );
}

export default Portfolio;
